INSERT INTO `faqs` (`FAQId`, `ProductId`, `Question`, `Answer`) VALUES
(1, 6, 'Q1. What makes My Nutrify Herbal & Ayurveda Wild Amla Juices unique?', 'Ans: Our wild Amla juice is crafted using traditional Ayurvedic methods and premium herbal ingredients. It is rich in natural antioxidants and vitamin C, offering a holistic approach to boosting your immunity and overall wellness.'),
(2, 6, 'Q2. How is the wild Amla juice prepared?', 'Ans: We use a cold-pressed extraction process to preserve the natural nutrients of wild Amla. The juice is blended with a carefully selected mix of herbal extracts according to Ayurvedic principles, ensuring maximum potency and purity.'),
(3, 6, 'Q3. What are the key health benefits of wild Amla juice?', 'Ans: Wild Amla juice is known for its high vitamin C content, which helps support immunity, aids digestion, and promotes healthy skin. Additionally, the Ayurvedic blend contributes to balancing the bodyâ€™s doshas, enhancing overall vitality.'),
(4, 6, 'Q4. Is My Nutrify Wild Amla Juice made with organic ingredients?', 'Ans: Yes, we prioritize natural purity. Our wild Amla and other herbal components are sourced from trusted organic farms, ensuring that you receive a product free from synthetic additives and preservatives.'),
(5, 6, 'Q5. How often should I consume wild Amla juice for optimal benefits?', 'Ans: For most individuals, a daily serving of wild Amla juice is recommended as part of a balanced diet. However, dosage may vary based on personal health needs. We advise consulting with an Ayurvedic practitioner or healthcare professional for personalized guidance.'),
(6, 9, 'Q.1 What is My Nutrify Herbal & Ayurveda Cholesterol Care Juice?', 'Ans. My Nutrify Herbal & Ayurveda Cholesterol Care Juice is a natural, Ayurvedic herbal supplement formulated to support healthy cholesterol levels and promote overall cardiovascular well-being. This herbal cholesterol juice combines time-tested Ayurvedic ingredients to help maintain a balanced lipid profile.'),
(7, 9, 'Q.2 What are the key ingredients in cholesterol care juice?', 'Ans. The juice is crafted from a blend of potent Ayurvedic herbs such as amla, turmeric, and other natural extracts known for their antioxidant and lipid-regulating properties. For a detailed list of ingredients, please refer to the product label.'),
(8, 9, 'Q.3 How does this herbal juice support healthy cholesterol levels?', 'Ans. This Ayurveda cholesterol care juice is designed to enhance the bodyâ€™s natural lipid metabolism and reduce oxidative stress. Its unique blend of herbal ingredients works synergistically to help maintain balanced cholesterol levels as part of a healthy lifestyle.'),
(9, 9, 'Q.4 How should I consume My Nutrify Herbal & Ayurveda Cholesterol Care Juice?', 'Ans. For optimal results, follow the dosage instructions on the packaging. Typically, before meals are recommended. However, it is best to consult your healthcare professional for personalized usage guidelines.'),
(10, 9, 'Q.5 Is My Nutrify Herbal & Ayurveda Cholesterol Care Juice safe for everyone?', 'Ans. Formulated with natural Ayurvedic herbs, this supplement is generally safe for most adults. Nonetheless, individuals with specific health conditions, those who are pregnant or nursing, or those taking prescription medications should consult a healthcare provider before starting any new supplement regimen.'),
(11, 9, 'Q.6 Are there any side effects associated with this herbal cholesterol juice?', 'Ans. Most users experience no adverse effects when using My Nutrify Herbal & Ayurveda Cholesterol Care Juice as directed. However, if you have known allergies to herbal'),
(12, 9, 'Q.7 Can I take this juice alongside my prescribed cholesterol medications?', 'Ans. While the juice is a natural supplement aimed at supporting cardiovascular health, it is important to consult with your healthcare provider before combining it with any prescribed cholesterol medications to avoid potential interactions.'),
(13, 9, 'Q.8 How long does it take to see improvements in cholesterol levels?', 'Ans. Results may vary by individual. With consistent use, along with a balanced diet and regular exercise, many users start noticing improvements in their cholesterol levels within a few weeks to a few months. A holistic approach to health is key for optimal results.'),
(14, 9, 'Q.9 What are the storage instructions and shelf life for the juice?', 'Ans. To maintain its potency, store the juice in a cool, dry place away from direct sunlight. Always check the product label for specific storage instructions and the expiration date to ensure freshness and efficacy.'),
(15, 9, 'Q.10 Where can I purchase My Nutrify Herbal & Ayurveda Cholesterol Care Juice?', 'Ans. You can buy this Ayurvedic herbal cholesterol care juice directly from the official My Nutrify website or through select authorized retailers. For the latest purchasing details and offers, visit our website or contact customer support.'),
(16, 23, 'What is My Nutrify Herbal & Ayurveda She Care Juice?', 'It is an all-natural, premium herbal juice specifically for women\'s well-being. The ayurvedic blend combines traditional herbs with the latest nutritional research to support energy, digestion, and hormonal health.'),
(17, 23, 'What are the major ingredients in this herbal juice?', 'Our juice contains a synergistic blend of natural extracts and ayurvedic herbs that include turmeric, ashwagandha, ginger, tulsi, and other effective botanicals. These are selected for their rejuvenating, anti-inflammatory, and antioxidant properties.'),
(18, 23, 'How is the juice supportive of women\'s health?', 'Through the power of ayurveda, this herbal beverage is developed to support overall wellness. Daily use can possibly balance hormones, improve metabolism, aid in detoxification, and enhance digestion—keys to healthy living.'),
(19, 23, 'Is My Nutrify She Care Juice to be taken any particular way?', 'For optimal effectiveness, take 30-50 ml once or twice a day, preferably on an empty stomach. Shake well before consumption to have the natural ingredients uniformly distributed. Take as required and adhere to any special instructions given by your healthcare provider.'),
(20, 23, 'Is this juice safe to consume daily?', 'Yes, if taken as instructed, our ayurvedic and herbal formula is safe to consume on a daily basis. But if you are pregnant, lactating, or have any underlying medical conditions, please seek advice from your healthcare professional before taking any new supplement.'),
(21, 23, 'Can I consume this juice along with my other medications or supplements?', 'Although our juice is derived from natural products, we do recommend that you consult with your healthcare practitioner if you\'re on any other medications or supplements. This will prevent any possible interactions and ensure it\'s part of your overall health regimen.'),
(22, 23, 'Where can I buy My Nutrify Herbal & Ayurveda She Care Juice?', 'You may purchase our product from our website or from licensed resellers. Be on the lookout for verified sellers to ensure you\'re getting the authentic, high-quality product.'),
(23, 23, 'How do I store the juice?', 'Store your juice in a dry, cool place and out of direct sunlight. Upon opening, best to refrigerate and consume within the time frame given on the package to preserve its effectiveness and freshness.'),
(24, 23, 'Why is this juice unique compared to other herbal drinks?', 'Our product is unique in its sole concentration on women\'s health, blending the wisdom of ancient ayurveda with contemporary nutritional knowledge. This special blend is designed to nurture female wellness, energy equilibrium, and overall vigor.'),
(25, 23, 'Are there any side effects to the juice?', 'The juice is made with natural, herbal ingredients and is generally well-tolerated. However, individual reactions can vary. If you experience any discomfort or adverse effects, discontinue use immediately and consult your healthcare professional.'),
(26, 22, 'What is My Nutrify Herbal & Ayurveda BP Care Juice?', 'It’s a 100% Ayurvedic, herbal formulation crafted to help manage blood pressure and support heart health using natural ingredients like Sarpgandha, Shankhpishi, and four additional herbal extracts.'),
(27, 22, 'What benefits can I expect from using this juice?', 'Regular use may help balance blood pressure levels, improve cholesterol profiles, support healthy circulation, and promote overall cardiovascular well-being—all thanks to its potent, natural herbal blend.'),
(28, 22, 'How should I consume the BP Care Juice?', 'Shake the bottle well before use. Then, dilute 30 ml of the juice in a glass of water. It’s best consumed on an empty stomach—typically in the morning—and you may also take it as advised by your healthcare professional.'),
(29, 22, 'Can I take this juice alongside my regular medications?', 'My Nutrify BP Care Juice is formulated with natural ingredients and is generally safe to use with allopathic medications. However, it’s important to consult your doctor before combining it with any prescription treatments.'),
(30, 22, 'Are there any side effects?', 'Since it’s made entirely from natural herbs, side effects are rare. If you experience any unusual symptoms or allergies, discontinue use and consult a healthcare professional.'),
(31, 22, 'Is the juice safe for pregnant or breastfeeding women?', 'While the product is made with natural ingredients, pregnant or breastfeeding women should seek advice from their healthcare provider before using the juice.'),
(32, 22, 'What is the shelf life of My Nutrify BP Care Juice?', 'The juice is designed to maintain its quality for up to 24 months from the manufacturing date. Always check the packaging for the exact expiration date.'),
(33, 22, 'How long does it take to see results?', 'Individual experiences may vary, but many users notice improvements within 2–3 months of consistent use.'),
(34, 22, 'How should I store the product?', 'Store the bottle in a cool, dry place away from direct sunlight. Once opened, following any specific storage instructions on the packaging (such as refrigeration) can help preserve its potency.'),
(35, 22, 'Where can I purchase My Nutrify BP Care Juice?', 'The juice is available directly on the My Nutrify official website as well as through select retail partners and authorized online stores.'),
(36, 25, 'What is My Nutrify Thyro Balance Juice?', 'My Nutrify Thyro Balance Juice is a natural supplement formulated to support healthy thyroid function and promote overall hormonal balance. Crafted with a unique blend of herbal ingredients, it is designed to enhance metabolism and well-being.'),
(37, 25, 'How does My Nutrify Thyro Balance Juice support thyroid health?', 'This juice is enriched with carefully selected natural herbs and vitamins that help regulate hormone levels and support optimal thyroid performance. Its formulation aims to boost energy levels and improve metabolic functions naturally.'),
(38, 25, 'What are the key ingredients in My Nutrify Thyro Balance Juice?', 'The product features a potent mix of traditional herbal extracts and essential nutrients. While the specific blend may vary, you can expect ingredients known for their thyroid-supportive properties—helping to maintain a balanced endocrine system.'),
(39, 25, 'Who can benefit from using My Nutrify Thyro Balance Juice?', 'Individuals seeking natural support for thyroid function and hormonal balance may find this juice beneficial. It’s ideal for those with mild thyroid concerns as well as anyone looking to enhance overall wellness through natural nutrition.'),
(40, 25, 'How should I use My Nutrify Thyro Balance Juice?', 'For best results, it is recommended to take one serving daily as directed on the product label. Many users prefer taking it on an empty stomach to maximize absorption and effectiveness.'),
(41, 25, 'Are there any side effects associated with My Nutrify Thyro Balance Juice?', 'Since the juice is made with natural ingredients, it is generally well tolerated. However, as with any dietary supplement, it’s important to consult your healthcare provider before use—especially if you have pre-existing conditions or are taking medications.'),
(42, 25, 'How long does it take to see results?', 'Results can vary by individual. Many users report experiencing enhanced energy levels and improved well-being within a few weeks of consistent use, though optimal benefits may take longer depending on your body’s response.'),
(43, 25, 'Is My Nutrify Thyro Balance Juice suitable for vegetarians or vegans?', 'Yes, the formulation is designed with natural, plant-based ingredients and is suitable for vegetarians. Please refer to the packaging or product details for confirmation regarding vegan compatibility.'),
(44, 25, 'Where can I purchase My Nutrify Thyro Balance Juice?', 'You can purchase My Nutrify Thyro Balance Juice through the official website or from authorized online retailers. Buying from verified sources ensures you receive a genuine product with full benefits.'),
(45, 25, 'What sets My Nutrify Thyro Balance Juice apart from other thyroid support supplements?', 'Unlike many other supplements, My Nutrify Thyro Balance Juice is uniquely formulated with a synergistic blend of high-quality herbal extracts aimed at providing holistic thyroid support. Its focus on natural ingredients and overall hormonal balance makes it a standout choice for those seeking a safe, effective way to enhance thyroid health.'),
(46, 14, 'What is My Nutrify Herbal & Ayurveda Wheat Grass Juice?', 'It’s a 100% natural wheatgrass juice made from premium 9th day–picked wheatgrass leaves. Crafted using herbal and Ayurvedic methods, it’s designed as a pure, nutrient-packed health drink.'),
(47, 14, 'What health benefits does this wheatgrass juice offer?', 'Wheatgrass juice is known to help detoxify the body, boost immunity, aid digestion, and provide essential vitamins, minerals, antioxidants, and amino acids that support increased energy and overall vitality.'),
(48, 14, 'Is this juice completely natural and free from additives?', 'Yes. My Nutrify Wheat Grass Juice is made with no added sugar, preservatives, or chemicals—it’s pure, natural, and adheres to Ayurvedic principles.'),
(49, 14, 'How should I store the wheatgrass juice?', 'To preserve its freshness and nutrients, keep the juice refrigerated and consume it within a few days after opening. Always check the label for any specific storage recommendations.'),
(50, 14, 'Is wheatgrass juice gluten-free?', 'Absolutely. Although it comes from wheatgrass, it’s harvested before the gluten-containing seed develops, making it naturally gluten-free.'),
(51, 14, 'What is the recommended daily intake?', 'Many users start with about 30–50 ml of wheatgrass juice on an empty stomach each morning. However, you can adjust your intake according to your personal health goals. If you have any medical concerns, consult a healthcare professional.'),
(52, 14, 'Are there any side effects?', 'Wheatgrass juice is generally safe for most people. In some cases, especially when taken in excess, it might cause mild digestive discomfort such as bloating or gas. If you’re allergic to grasses or have specific health conditions, please consult your doctor before use.'),
(53, 14, 'Who can benefit from using this juice?', 'It’s ideal for adults looking to enhance their overall well-being. However, if you are pregnant, nursing, or have any chronic health issues, it’s best to seek advice from your healthcare provider before adding it to your routine.'),
(54, 14, 'Can I mix this wheatgrass juice with other beverages?', 'Yes, While it’s most effective when taken on an empty stomach, you can blend it with other juices or add it to a smoothie if you prefer a milder taste.'),
(55, 14, 'How is the juice prepared?', 'The juice is extracted from freshly harvested wheatgrass using methods that minimize oxidation and preserve its active enzymes and nutrients. This traditional process ensures you receive a potent, high-quality herbal supplement.'),
(56, 6, 'Are there any side effects of consuming wild Amla juice?', 'Our juice is formulated to be gentle on the body. That said, if you have a specific health condition or are on medication, it’s best to consult with a healthcare provider before incorporating any new supplement into your routine.'),
(57, 6, 'How should I store My Nutrify Wild Amla Juices?', 'To maintain freshness and nutritional value, store the juice in a cool, dark place or refrigerate after opening. Always follow the storage guidelines provided on the packaging.'),
(58, 6, 'What is the shelf life of the product?', 'Our wild Amla juice is carefully processed to ensure maximum freshness. The shelf life typically spans several weeks when stored correctly. Check the expiration date on the bottle for the most accurate information.'),
(59, 6, 'Can this juice aid in digestion and boost immunity?', 'Absolutely. The Ayurvedic formulation of our wild Amla juice is designed to support digestive health and boost the immune system, making it an ideal addition to your daily wellness routine.'),
