INSERT INTO `product_master` (`ProductId`, `Description`, `CategoryId`, `SubCategoryId`, `ProductName`, `MetaTags`, `MetaKeywords`, `ShortDescription`, `PhotoPath`, `Specification`, `VideoURL`, `ProductCode`, `IsCombo`, `Title`) VALUES
