(11, 'My Nutrify Herbal and Ayurveda\'s Karela Neem & Jamun Juice is a powerful Ayurvedic blend for overall wellness, especially beneficial for diabetes management. Neem (Azadirachta Indica), known for its medicinal properties, is freshly sourced from Rajasthan. Karela (Bitter Gourd) is packed with essential nutrients like vitamins, antioxidants, and minerals, making it a vital ingredient in herbal remedies. Jamun (Syzygium Cumini), rich in Vitamin A & C, enhances digestion and promotes healthy skin. We use dry Jamun seeds to maximize its Anti-aging and digestive benefits, ensuring you get\nthe purest and most effective juice for your health.', 1, 4, 'My Nutrify Herbal & Ayurveda\'s Karela Neem & Jamun Juice -  1 Ltr | Supports Blood Sugar, Digestion & Detox | Pure Herbal Health Tonic. ', 'My Nutrify Herbal & Ayurveda\'s Karela Neem & Jamun Juice - 1 Ltr | Supports Blood Sugar, Digestion & Detox | Pure Herbal Health Tonic. ', 'My Nutrify Herbal & Ayurveda\'s Karela Neem & Jamun Juice - 1 Ltr | Supports Blood Sugar, Digestion & Detox | Pure Herbal Health Tonic. ', 'Nutrify Herbal & Ayurveda  Karela Neem & Jamun Juice is an effective combination of natural ingredients famous for their medicinal properties. Formulated from Neem, Karela (bitter gourd), and Jamun (Indian blackberry), this juice assists in maintaining healthy blood sugar levels, enhances digestion, and supports immunity. Being rich in antioxidants and essential nutrients, it supports detoxification, encourages glowing skin, and contributes to overall wellness. An ideal daily tonic for a healthier lifestyle.', '7133.jpg', '<div id=\"importantInformation_feature_div\" class=\"celwidget\" data-feature-name=\"importantInformation\" data-csa-c-type=\"widget\" data-csa-c-content-id=\"importantInformation\" data-csa-c-slot-id=\"importantInformation_feature_div\" data-csa-c-asin=\"\" data-csa-c-is-in-initial-active-row=\"false\" data-csa-c-id=\"lls474-z1671h-6k40jb-kg9e4h\" data-cel-widget=\"importantInformation_