(14, 'Detox Naturally with My Nutrify Herbal and Ayurveda\'s Wheatgrass Juice Your Ultimate Herbal Cleanser! Revitalize your body with the pure goodness of My Nutrify\'s Wheatgrass Juice. Packed with nature\'s finest, it\'s completely free from added sugar or artificial flavors, ensuring you get nothing but the best.\nIt is a rich source of essential vitamins and minerals like iron, potassium, and chlorophyll, which aid in detoxification and digestion. It also contains vitamins A, C, E, and K, along with beneficial enzymes.', 1, 2, 'My Nutrify Herbal & Ayurveda\'s  Wheatgrass Juice - 1 Ltr | 100% Natural Detox & Immunity Booster | Rich in Chlorophyll, Vitamins & Antioxidants, Supports Digestion & Metabolism ', 'My Nutrify Herbal & Ayurveda\'s  Wheatgrass Juice - 1 Ltr  | 100% Natural Detox & Immunity Booster | Rich in Chlorophyll, Vitamins & Antioxidants | Supports Digestion & Metabolism | 500ml', 'My Nutrify Herbal & Ayurveda\'s  Wheatgrass Juice - 1 Ltr  | 100% Natural Detox & Immunity Booster | Rich in Chlorophyll, Vitamins & Antioxidants | Supports Digestion & Metabolism | 500ml', 'My Nutrify Herbal & Ayurveda Wheat Grass Juice is a pure, organic detox drink made from eco-friendly, ethically sourced wheatgrass, rich in chlorophyll, antioxidants, and essential nutrients. It helps cleanse the liver, boost immunity, improve digestion, and enhance energy levels. Packed with vitamins A, C, and E, along with iron and magnesium, it supports skin health, muscle function, and overall vitality. Free from chemicals and artificial additives, this daily health tonic is perfect for anyone seeking a natural, Ayurvedic way to energize, detoxify, and maintain an active lifestyleâ€”now available in eco-friendly packaging.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '9976.jpg', '<span id=\"docs-internal-guid-6c1e8d95-7fff-95d4-ca51-8484cab2df98\"><ul style=\"margin-bottom: 0px; padding-inline-start: 48px;\"><li dir=\"ltr\" style=\"list-style-type: disc; font-size: 10pt; font-family: Geo