(23, 'She Care Plus Juice is an Ayurvedic herbal blend designed to support hormonal balance in women. It helps regulate the menstrual cycle, maintain reproductive health, and improve skin by reducing pimples, acne, and other hormonal imbalance-related issues.', 1, 5, 'My Nutrify Herbal & Ayurveda\'s She Care plus Juice â€“ A Natural Women\'s Health Drink for Hormonal Balance, Period Relief, and Skin & Hair Support | Detox, Digestion & Immunity | PCOD/PCOS | 1 Ltr ', 'My Nutrify Herbal & Ayurveda\'s She Care plus Juice â€“ A Natural Women\'s Health Drink for Hormonal Balance, Period Relief, and Skin & Hair Support | Detox, Digestion & Immunity | PCOD/PCOS | 1 Ltr ', 'My Nutrify Herbal & Ayurveda\'s She Care plus Juice â€“ A Natural Women\'s Health Drink for Hormonal Balance, Period Relief, and Skin & Hair Support | Detox, Digestion & Immunity | PCOD/PCOS | 1 Ltr ', 'My Nutrify Herbal & Ayurveda\'s She Care Plus Juice is a powerful Ayurvedic blend crafted to support womenâ€™s reproductive health and hormonal balance. Enriched with herbs like Bel ka Fal, Adusa, Nagarmotha, Rasaut, Daru Haldi, and Amla, it helps manage menstrual irregularities, PCOD/PCOS symptoms, mood swings, fatigue, and acne. This natural tonic works from within to detoxify the reproductive system, regulate cycles, and restore hormonal harmonyâ€”supporting a pain-free, balanced, and vibrant life. 100% natural, free from chemicals and added hormones, itâ€™s safe for daily use and ideal for every stage of womanhood.', '2081.jpg', '<p><span id=\"docs-internal-guid-419467a4-7fff-aa0a-7f33-c445dc454650\"></span></p><ul style=\"margin-top:0;margin-bottom:0;padding-inline-start:48px;\"><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Georgia,serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:12pt;margin-