(25, 'My Nutrify Herbal & Ayurveda\'s Thyro Balance Care Juice is a natural blend of 20+ Ayurvedic herbs like Kanchnar, Shuddh Shilajit, Guggulu, and Brahmi. It supports healthy thyroid function, boosts metabolism, and balances hormones. Helps manage fatigue, weight issues, and mood swings. 100% natural with No added sugar or chemicals.', 1, 1, 'My Nutrify Herbal & Ayurveda\'s Thyro Balance Care Juice â€“ 1 Ltr |  Natural Thyroid Support, Energy Booster & Metabolism Enhancer.', 'My Nutrify Herbal & Ayurveda\'s Thyro Balance Juice â€“ 1 Ltr |  Natural Thyroid Support, Energy Booster & Metabolism Enhancer, 1000ml', 'My Nutrify Herbal & Ayurveda\'s Thyro Balance Juice â€“ 1 Ltr |  Natural Thyroid Support, Energy Booster & Metabolism Enhancer, 1000ml', 'My Nutrify Herbal & Ayurveda\'s Thyro Balance Care Juice is a 100% natural Ayurvedic blend designed to support optimal thyroid function, hormonal balance, and metabolic health. Infused with potent herbs like Jatamansi, Guggulu, Gokshur, and Jyotishmati, it helps regulate thyroid hormone levels, boost energy, support mental clarity, reduce inflammation, and promote healthy skin, hair, and digestion. Ideal for those with thyroid imbalances or seeking overall hormonal wellness, this fast-absorbing liquid supplement is sustainably packaged and easy to integrate into daily routinesâ€”your natural path to balanced energy and endocrine health.\r\n', '1368.jpg', '', NULL, 'MN-C2100', '', 'Thyro Balance Care Juice'),
(34, 'My Nutrify Cholesterol Care juice:\nMy Nutrify Herbal & Ayurveda\'s Cholesterol Care Juice is a powerful blend of fresh-pressed raw garlic, zesty ginger, and refreshing lemon juices, expertly blended with organic apple cider vinegar and pure honey. Each component is specifically chosen for its individual heart-healthy properties, working in harmony to assist with cholesterol balancing and overall cardiovascular function. Take a daily sip to feed your heart and boost your well-being. \n\nMy Nutrify Diabetic Care Juice:\nMy Nutrify Herbal & Ayurveda\'s Diabetic Care Juice helps keep your blood sugar levels in check! Made with a powerful blend of 13 herbs and superfoods, this natural juice supports healthy blood sugar management. It\'s easy to drink and boosts overall health. Each batch is crafted using raw herbs sourced from trusted farms, following traditional Ayurvedic practices.', 1, 1, 'My Nutrify Herbal & Ayurveda\'s Cholesterol care Juice & Diabetic Care Juice combo', 'My Nutrify Herbal & Ayurveda\'s Cholesterol care Juice & Diabetic Care Juice combo', 'My Nutrify Herbal & Ayurveda\'s Cholesterol care Juice & Diabetic Care Juice combo', 'Cholesterol Care Juice: A natural blend of garlic, ginger, lemon, apple cider vinegar, and honey to help support a healthy heart and cholesterol levels.\r\nDiabetic Care Juice: A herbal juice with 13 powerful ingredients to help manage blood sugar and boost overall health.', '4348.jpg', '', NULL, 'MN-C1200', 'Y', 'Cholesterol care Juice & Diabetic Care Juice combo'),
(35, 'My Nutrify Herbal & Ayurveda\'s Diabetic Care Juice:\nMy Nutrify Diabetic Care Juice is a natural way to maintain healthy blood sugar levels. Made with 13 powerful herbs and superfoods, it supports overall wellness and balances blood sugar naturally. This pure Ayurvedic juice is crafted using traditional methods with raw herbs sourced from trusted Indian farms. It\'s easy to consume and offers additional health benefits for a healthier life!\n\nMy Nutrify Herbal & Ayurveda\'s BP Care Juice:\nMy Nutrify BP Care Juice is an Ayurvedic blend of 5 powerful herbs. It contains Sarpagandha and Rudraksh to regulate blood pressure, Bach for better metabolism, Jatamansi to manage high BP, and Sankhpushpi to boost immunity and energy.', 1, 1, 'My Nutrify Herbal & Ayurveda\'s Diabetic Care Juice | BP Care Juice combo', 'My Nutrify Herbal & Ayurveda\'s Diabetic Care Juice | BP Care Juice combo', 'My Nutrify Herbal & Ayurveda\'s Diabetic Care Juice | BP Care Juice combo', 'Diabetic Care Juice: A natural Ayurvedic blend of 13 herbs and superfoods that help maintain healthy blood sugar levels and overall wellness. Made using traditional methods with raw herbs from trusted Indian farms.\r\nBP Care Juice: A powerful Ayurvedic mix of 5 herbs, including Sarpagandha and Jatamansi, to help regulate blood pressure, support metabolism, and boost immunity.', '1204.jpg', '', NULL, ' MN-C2200', 'Y', 'Diabetic Care Juice | BP Care Juice combo'),
(36, 'BP Care Juice\nMy Nutrify Herbal & Ayurveda\'s BP Care Juice is a powerful Ayurvedic formulation crafted from a blend of 5 natural herbs. This blood pressure care juice contains the goodness of Sarpagandha and Rudraksh, which help regulate and manage blood pressure effectively. Bach works to enhance metabolism, while Jatamansi helps lower blood pressure and keep it within a healthy range. Additionally, Shankhpushpi supports immunity and rejuvenates the entire body for improved overall wellness.\nCholesterol Care Juice\n\nMy Nutrify Herbal & Ayurveda\'s Cholesterol Care Juice is apowerful herbal blend designed to support heart health and manage cholesterol naturally. Made with fresh garlic, ginger, lemon, apple cider vinegar, and honey, this juice helps reduce bad cholesterol (LDL), strengthen heart muscles, and improve blood circulation. It also aids in reducing stress, anxiety, and promoting overall cardiovascular wellness. Regular consumption can help maintain a healthy heart, boost vitality, and enhance overall well-being.', 1, 1, 'My Nutrify Herbal & Ayurveda\'s BP Care Juice | Cholesterol Care Juice combo', 'My Nutrify Herbal & Ayurveda\'s BP Care Juice | Cholesterol Care Juice combo', 'My Nutrify Herbal & Ayurveda\'s BP Care Juice | Cholesterol Care Juice combo', 'BP Care Juice: A natural Ayurvedic blend of 5 powerful herbs, including Sarpagandha and Jatamansi, to help regulate blood pressure, improve metabolism, and boost immunity for overall wellness.\r\n\r\nCholesterol Care Juice: A heart-friendly mix of garlic, ginger, lemon, apple cider vinegar, and honey to help manage cholesterol, support heart health, and improve blood circulation.', '6289.png', '', NULL, 'MN-C3200', 'Y', 'BP Care Juice | Cholesterol Care Juice combo'),
(37, 'Wild Amla Juice: Made from fresh wild Indian gooseberries, this vitamin C-rich juice boosts immunity, improves digestion, and promotes healthy skin and hair.\n\nShe Care Plus Juice: A herbal blend designed for women\'s wellness, supporting hormone balance, digestion, metabolism, and overall energy.', 1, 5, 'My Nutrify Herbal & Ayurveda\'s she care plus Juice | amla Juice combo', 'My Nutrify Herbal & Ayurveda\'s she care plus Juice | amla Juice combo', 'My Nutrify Herbal & Ayurveda\'s she care plus Juice | amla Juice combo', 'Wild Amla Juice: Made from fresh wild Indian gooseberries, this vitamin C-rich juice boosts immunity, improves digestion, and promotes healthy skin and hair.\r\n\r\nShe Care Plus Juice: A herbal blend designed for womenâ€™s wellness, supporting hormone balance, digestion, metabolism, and overall energy.', '3760.png', '', NULL, 'MN-C4200', 'Y', 'My Nutrify Herbal & Ayurveda\'s she care plus Juice | amla Juice combo'),
(38, 'My Nutrify Apple Cider Vinegar:\nMy Nutrify Herbal & Ayurveda\'s Apple Cider Vinegar is pure, unfiltered, and packed with vitamins, minerals, and antioxidants. Made from the finest apples, it supports overall health, boosts metabolism, and helps with weight management by controlling hunger and promoting a feeling of fullness.\n\nMy Nutrify Wheatgrass Juice:\nMy Nutrify Herbal & Ayurveda\'s Wheatgrass Juice is made from 100%pure wheatgrass plant, carefully extracted to retain its natural potency. Known for its detoxifying properties, it helps improve digestion, boost metabolism, enhance gut health, and support healthy weight management. Its rich fiber content aids in smoother bowel movements, while its natural nutrients may reduce hunger and control cravings for a balanced, healthful lifestyle.', 1, 2, 'My Nutrify Herbal & Ayurveda\'s Apple Cider Vinegar | Wheatgrass Juice Combo', 'My Nutrify Herbal & Ayurveda\'s Apple Cider Vinegar | Wheatgrass Juice Combo', 'My Nutrify Herbal & Ayurveda\'s Apple Cider Vinegar | Wheatgrass Juice Combo', 'Apple Cider Vinegar: Pure and unfiltered, this vinegar supports metabolism, weight management, and overall health with its rich vitamins and antioxidants.\r\n\r\nWheatgrass Juice: A natural detoxifier that improves digestion, boosts metabolism, and supports weight management while promoting gut health.', '1473.jpg', '', NULL, 'MN-C5200', 'Y', 'Apple Cider Vinegar | Wheatgrass Juice Combo'),
(39, 'My Nutrify Karela,Neem&Jamun :\nMy Nutrify Herbal & Ayurveda\'s Karela Neem & Jamun Juice is made with a balanced blend of Karela, Neem, and Jamun, each offering unique health benefits. This 100% pure and preservative-free juice is especially beneficial for diabetic patients, as it helps regulate blood sugar levels. It also purifies the blood due to its antioxidant properties, enhances digestion, boosts immunity, and supports the healthy functioning of the pancreas and liver.\nMy Nutrify Diabetic Care Juice:\nMy Nutrify Herbal & Ayurveda\'s Diabetic Care Juice helps keep your blood sugar levels in check! Made with a powerful blendof 13 herbs and superfoods, this natural juice supports healthy blood sugar management. It\'s easy to drink and boosts overall health. Each batch is crafted using raw herbs sourced from trusted farms, following traditional Ayurvedic practices.', 1, 1, 'My Nutrify Herbal & Ayurveda\'s Karela Neem & Jamun And Diabetic care Juice Combo', 'My Nutrify Herbal & Ayurveda\'s Karela Neem & Jamun And Diabetic care Juice Combo', 'My Nutrify Herbal & Ayurveda\'s Karela Neem & Jamun And Diabetic care Juice Combo', 'Karela Neem & Jamun Juice: A natural blend that helps regulate blood sugar, purify the blood, improve digestion, and support liver and pancreas health.\r\n\r\nDiabetic Care Juice: A powerful mix of 13 herbs and superfoods to support healthy blood sugar levels and overall well-being.', '8490.jpg', '', NULL, 'MN-C6200', 'Y', 'Karela, Neem & Jamun And Diabetic care Juice Combo'),
(40, 'My Nutrify Karela Neem & Jamun Juice:\nMy Nutrify Herbal & Ayurveda\'s Karela Neem & Jamun Juice is a natural blend of Karela, Neem, and Jamun. This 100% pure, preservative-free juice helps manage blood sugar, purify the blood, improve digestion, boost immunity, and support the pancreas and liver making it especially beneficial for diabetics.\n\nMy Nitrify bp care juice:\nMy Nutrify Herbal & Ayurveda\'s BP Care Juice is a natural Ayurvedic formulation crafted from a blend of 10 powerful herbs to support healthy blood pressure. It contains Sarpagandha and Rudraksh, known for their ability to regulate and manage blood pressure effectively. Bach helps enhance metabolism, while Jatamansi works to lower and stabilize blood pressure, keeping it within a healthy range. Additionally, Shankhpushpi strengthens immunity and revitalizes the body, promoting overall wellness. This herbal juice offers a holistic, natural solution for maintaining heart health and balanced well-being.', 1, 1, 'My Nutrify Herbal & Ayurveda\'s Karela neem & jamun juice and bp care juice Combo', 'My Nutrify Herbal & Ayurveda\'s Karela neem & jamun juice and bp care juice Combo', 'My Nutrify Herbal & Ayurveda\'s Karela neem & jamun juice and bp care juice Combo', 'Karela Neem & Jamun Juice: A pure, preservative-free blend that helps manage blood sugar, purify the blood, support digestion, and boost immunityâ€”ideal for diabetic care and overall wellness.\r\n\r\nBP Care Juice: A herbal mix of 10 Ayurvedic ingredients like Sarpagandha and Jatamansi to naturally manage blood pressure, boost metabolism, and strengthen immunity for a healthy heart and balanced body.', '4367.jpg', '', NULL, 'MN-C7200', 'Y', 'Karela neem & jamun juice and bp care juice Combo'),
(41, 'My Nutrify Wild Amla Juice:\nMy Nutrify Herbal & Ayurveda\'s Wild Amla Juice is made from fresh, ripe amla (gooseberries) to preserve its natural goodness. Rich in vitamin C, iron, and essential nutrients, it supports overall health by boosting immunity, strengthening bones, aiding weight management, and improving body function.\n\nMy Nutrify Apple Cider Vinegar:\nMy Nutrify Herbal & Ayurveda\'s Apple Cider Vinegar is a luxurious, unfiltered juice derived from the best apples. With high vitamin, mineral, and antioxidant content, it occurs naturally to aid digestion, stimulate metabolism, and induce fullness to help manage weight. Adopt this pure tonic as a gateway to greater vigor and overall health.\n', 1, 1, 'My Nutrify Herbal & Ayurveda\'s Wild Amla Juice  & Apple Cider Vinegar Juice Combo', 'My Nutrify Herbal & Ayurveda\'s Wild Amla Juice  & Apple Cider Vinegar Juice Combo', 'My Nutrify Herbal & Ayurveda\'s Wild Amla Juice  & Apple Cider Vinegar Juice Combo', 'Wild Amla Juice: Made from fresh amla, this vitamin C-rich juice boosts immunity, strengthens bones, aids in weight management, and supports overall health.\r\n\r\nApple Cider Vinegar: A pure, unfiltered tonic made from premium applesâ€”supports digestion, boosts metabolism, and helps with weight management naturally.', '5097.jpg', '', NULL, 'MN-C8200', 'Y', 'Wild Amla Juice  & Apple Cider Vinegar Juice Combo'),
(42, '\nMy Nutrify Wild Amla Juice:\nMy Nutrify Herbal & Ayurveda\'s Wild Amla Juice is made from freshly picked, fully ripe amla berries to retain their natural, pure goodness. Rich in vitamin C, iron, and essential nutrients, this powerful extract boosts immunity, promotes bone health, and helps with weight management giving nature\'s best gift for everyday wellness.\n\nMy Nutrify Wheatgrass Juice:\nMy Nutrify Herbal & Ayurvedas Wheatgrass Juice (1ltr) combine nature\'s nutrition with modern wellness. Rich in required vitamins, minerals, and antioxidants, this blend supports healthy hemoglobin levels, boosts energy, and enhances immunity. Ideal for daily use, it revitalizes your system for a naturally healthier, more energetic life.', 1, 2, 'My Nutrify Herbal & Ayurveda\'s Wild Amla Juice  & Wheatgrass Combo', 'My Nutrify Herbal & Ayurveda\'s Wild Amla Juice  & Wheatgrass Combo', 'My Nutrify Herbal & Ayurveda\'s Wild Amla Juice  & Wheatgrass Combo', 'Wild Amla Juice: Made from ripe, fresh amla berries, this juice is packed with vitamin C and nutrients to boost immunity, strengthen bones, and support weight management for daily wellness.\r\n\r\nWheatgrass Juice: A nutrient-rich blend that supports healthy hemoglobin, boosts energy, and strengthens immunityâ€”perfect for daily detox and overall vitality.', '6528.png', '', NULL, 'MN-C9200', 'Y', 'Wild Amla Juice  & Wheatgrass Combo');
