(43, 'My Nutrify Thyro Balance care Juice:\nMy Nutrify Herbal & Ayurveda Thyro Balance Juice is an Ayurvedic,natural tonic that is filled with vital vitamins and fiber. It soothingly calms stress and anxiety and lowers hypersensitivity, making it a great option for detox and cleansing. Take a sip to reset your body, calm your mind, and rebalance naturally.\n\nMy Nutrify Apple Cider Vinegar:\nMy Nutrify Herbal & Ayurveda Apple Cider Vinegar finest unfiltered juice made from high-quality apples. Filled with natural vitamins, minerals, and antioxidants, it nourishes digestion, increases metabolism, and maintains weight, adding to your well-being with each glass.', 1, 1, 'My Nutrify Herbal & Ayurveda\'s Thyro Balance care juice & Apple Cider vinegar Juice Combo', 'My Nutrify Herbal & Ayurveda\'s Thyro Balance care juice & Apple Cider vinegar Juice Combo', 'My Nutrify Herbal & Ayurveda\'s Thyro Balance care juice & Apple Cider vinegar Juice Combo', 'Thyro Balance Care Juice: A calming Ayurvedic tonic rich in vitamins and fiber that helps reduce stress, support detox, and naturally rebalance the body.\r\n\r\nApple Cider Vinegar: Made from high-quality apples, this unfiltered vinegar supports digestion, boosts metabolism, and helps manage weight for better overall wellness.', '2698.jpg', '', NULL, 'MN-C10200', 'Y', 'Thyro Balance care juice & Apple Cider vinegar Juice Combo'),
(44, 'My Nutrify Thyro Balance care Juice:\nMy Nutrify Herbal & Ayurveda’s Thyro Balance Juice is an Ayurvedic herbal tonic enriched with essential vitamins and fiber. It gently eases stress and anxiety while reducing sensitivity, making it an ideal choice for a natural detox and cleanse. Enjoy a sip to rejuvenate your body, soothe your mind, and restore harmony naturally.\n\nMy Nutrify Wild Amla Juice:\nMy Nutrify Herbal & Ayurveda\'s Wild Amla Juice is made from just-picked, completely ripe amla berries to maintain their pure natural integrity. Packed with vitamin C, iron, and other critical nutrients, this concentrated extract boosts a healthy immune system, fortifies bone structure, and facilitates weight control bringing nature\'s best gift for daily energy.', 1, 1, 'My Nutrify Herbal & Ayurveda\'s Thyro Balance  care juice & Wild Amla Juice Combo', 'My Nutrify Herbal & Ayurveda\'s Thyro Balance  care juice & Wild Amla Juice Combo', 'My Nutrify Herbal & Ayurveda\'s Thyro Balance  care juice & Wild Amla Juice Combo', 'Thyro Balance Care Juice: A soothing Ayurvedic blend with essential vitamins and fiber that helps reduce stress, support natural detox, and restore balance for overall well-being.\r\n\r\nWild Amla Juice: Made from freshly picked ripe amla, this nutrient-rich juice boosts immunity, strengthens bones, and aids in weight management perfect for daily vitality.', '6359.jpg', '', NULL, 'MN-C11200', 'Y', 'Thyro Balance  care juice & Wild Amla Juice Combo'),
(45, 'My Nutrify Thyro Balance care juice\nMy Nutrify Herbal & Ayurveda\'s Thyro Balance Juice, an Ayurvedic elixir that is supplemented with essential vitamins and fiber. This soothing tonic calms stress and anxiety, decreasing sensitivity as well, so it is ideal to have on hand for a natural cleanse and detox. Drink to revitalize your body, soothe your mind, and restore inner harmony naturally.\n\nMy Nutrify Karela neem & jamun juice\nMy Nutrify Herbal & Ayurveda\'s Karela Jamun Neem Juice is a wonderful combination of bitter Karela, juicy Jamun, and Neem. Made with 100% pure, preservative-free herbs, this natural juice helps regulate blood sugar levels, cleanse the blood, and improve digestion. Its immunity-boosting properties, combined with pancreatic and liver support, make it a beneficial tonic for diabetic management and general well-being.', 1, 1, 'My Nutrify Herbal & Ayurveda\'s Thyro Balance care juice & Karela neem & jamun juice Combo', 'My Nutrify Herbal & Ayurveda\'s Thyro Balance care juice & Karela neem & jamun juice Combo', 'My Nutrify Herbal & Ayurveda\'s Thyro Balance care juice & Karela neem & jamun juice Combo', 'Thyro Balance Care Juice: A natural Ayurvedic drink that helps reduce stress, supports detox, and brings balance to your body and mind.\r\n\r\nKarela Neem & Jamun Juice: A pure herbal blend that helps manage blood sugar, cleanses the blood, improves digestion, and supports overall health especially for diabetics.', '1518.jpg', '', NULL, 'MN-C12200', 'Y', 'Thyro Balance care juice & Karela neem & jamun juice Combo'),
(46, 'My Nutrify Karela neem & jamun juice:\nMy Nutrify Herbal & Ayurveda\'s Karela Jamun Neem Juice combines the unique properties of bitter Karela, juicy Jamun, and pungent Neem into a strong herbal tonic. Made from 100% pure, preservative-free herbs, it helps to regulate balanced blood sugar levels, cleanse the blood, and boost digestive health. With its strong immunity boost and positive impact on the pancreas and liver, this juice is a great tonic for diabetic management and overall health.\n\nMy Nutrify Cholesterol Care juice:\nMy Nutrify Herbal & Ayurveda\'s Cholesterol Care Juice is a powerful blend of fresh-pressed raw garlic, zesty ginger, and refreshing lemon juices, expertly blended with organic apple cider vinegar and pure honey. Each component is specifically chosen for its individual heart-healthy properties, working in harmony to assist with cholesterol balancing and overall cardiovascular function. Take a daily sip to feed your heart and boost your well-being.', 1, 1, 'My Nutrify Herbal & Ayurveda\'s Cholesterol Care juice & Karela neem & jamun juice Combo', 'My Nutrify Herbal & Ayurveda\'s Cholesterol Care juice & Karela neem & jamun juice Combo', 'My Nutrify Herbal & Ayurveda\'s Cholesterol Care juice & Karela neem & jamun juice Combo', 'Karela Neem & Jamun Juice: A natural blend of Karela, Jamun, and Neem that helps manage blood sugar, purify the blood, support digestion, and boost immunity ideal for diabetic care and overall wellness.\r\n\r\nCholesterol Care Juice: A heart-friendly mix of garlic, ginger, lemon, apple cider vinegar, and honey that helps balance cholesterol, support heart health, and improve overall cardiovascular wellness.\r\n', '3402.jpg', '', NULL, 'MN-C13200', 'Y', 'Cholesterol Care juice & Karela neem & jamun juice Combo'),
(47, 'My Nutrify She Care Plus Juice:\nMy Nutrify Herbal & Ayurveda\'s She Care Plus Juice is a simple Ayurvedic herbal drink that helps balance hormones for women. It supports regular menstrual cycles and a healthy reproductive system while reducing skin issues like pimples, acne, and blisters caused by hormonal changes.\n\nMy Nutrify Apple Cider Vinegar Juice :\nMyNutrify Herbal & Ayurveda’s Apple Cider Vinegar is a delectable, unfiltered juice made from the best apples, retaining nature\'s entire wealth. Every glass contains vital vitamins, minerals, and antioxidants that support easy digestion, increase metabolism, and assist in weight management—rendering it a tasty everyday pick-me-up for your well-being.', 1, 5, 'My Nutrify Herbal & Ayurveda\'s She Care Plus Juice & Apple Cider vinegar Juice Combo', 'My Nutrify Herbal & Ayurveda\'s She Care Plus Juice & Apple Cider vinegar Juice Combo', 'My Nutrify Herbal & Ayurveda\'s She Care Plus Juice & Apple Cider vinegar Juice Combo', 'She Care Plus Juice: An Ayurvedic juice for women that helps balance hormones, supports menstrual health, and reduces skin problems like acne and pimples caused by hormonal changes.\r\n\r\nApple Cider Vinegar Juice: A pure, unfiltered vinegar made from the best applesâ€”helps with digestion, boosts metabolism, and supports weight management for daily wellness.', '1494.jpg', '', NULL, 'MN-C14200', 'Y', 'She Care Plus Juice & Apple Cider vinegar Juice Combo'),
(49, 'My Nutrify BP Care Juice:\nMy Nutrify Herbal & Ayurveda\'s BP Care Juice is an Ayurvedic herbal synergistic blend designed for heart health. Bach increases metabolism, and Jatamansi and Sarpagandha combine to soothe the body and stabilize blood pressure. Sankhpushpi increases immunity, Arjuna fortifies the heart, and Brahmi reduces stress. These are supported by Rudraksh to support healthy pressure, Mint for digestion, Suddh Guggal for anti-inflammatory benefits, and Lahsun (garlic) for healthy cholesterol levels.\n\nMy Nutrify Apple Cider Vinegar Juice :\nMy Nutrify Herbal & Ayurveda\'s Apple Cider Vinegar is a delectable, unfiltered juice made from the best apples, retaining nature\'s entire wealth. Every glass contains vital vitamins, minerals, and antioxidants that support easy digestion, increase metabolism, and assist in weight management rendering it a tasty everyday pick-me-up for your well-being.', 1, 1, 'My Nutrify Herbal & Ayurveda\'s BP Care Juice &  Apple Cider vinegar Juice Combo', 'My Nutrify Herbal & Ayurveda\'s BP Care Juice &  Apple Cider vinegar Juice Combo', 'My Nutrify Herbal & Ayurveda\'s BP Care Juice &  Apple Cider vinegar Juice Combo', 'BP Care Juice: A powerful Ayurvedic blend of 10 herbs that helps manage blood pressure, boost heart health, improve metabolism, reduce stress, and support overall wellness.\r\n\r\nApple Cider Vinegar Juice: A pure, unfiltered vinegar made from premium apples supports digestion, boosts metabolism, and helps with weight management for daily vitality.', '7336.jpg', '', NULL, 'MN-C15200', 'Y', 'BP Care Juice &  Apple Cider vinegar Juice Combo');
