INSERT INTO `product_review` (`Product_ReviewId`, `ProductId`, `PhotoPath`, `Name`, `Review`, `Date`) VALUES
(1, 12, 'review(17).jpg', 'Greena Singla', 'I love this product. I am surviving for pcos and pcod problem & irregular periods.. I just consume only 1 bottle of she care and my periods have arrived on exact time after 1 month. I am very happy right now ..Thanku krishna herbal she care juice .😊', '2025-02-05'),
(2, 12, 'review(18).jpg', 'Vandana Rajput', 'Amazing, it has shown me results within 20 days. I was having irregular periods from last few months and I saw the advertisement on insta and ordered the bottle. My period were always delayed but after taking this from last 20 days, I got my period on exact date after so long.', '2025-01-12'),
(3, 12, 'review(19).jpg', 'Mukesh Sharma', 'Good product', '2025-01-31'),
(4, 12, 'review(20).jpg', 'Saneha Jahal', 'Very Nice juice. Mere 3 saal ke ireguler period or Digestive system ko bhi bohot theek jaldi theek ho gya. Mere liye yeh amrit se kum nhi hai👌👌👌. Thank you so much ☺☺', '2024-11-17'),
(5, 12, 'review(21).jpg', 'Rekha Jain', 'Very Best Product , Very Effective', '2022-04-12'),
(6, 12, 'review(22).jpg', 'Manisha', 'A good product. I\'m hopeful it\'s gonna help me for my condition. I\'m using it for a past one month and I\'m improving', '2025-03-08');
